import { useState } from 'react';
import './User.css';
import 'bootstrap/dist/css/bootstrap.css';

    function User({name, city, age, email, phone, gender, imglink}) {

        return (
            <div className="row">
                <img src={imglink} alt="profile picture" style={{width:'80px', height:'50px'}}></img>
                <div className="col-1">{name}</div>
                <div className="col-1">{city}</div>
                <div className="col-1">{""+age}</div>
                <div className="col-2">{email}</div>
                <div className="col-1">{phone}</div>
            </div>
        );
    }
    export default User;
